import React from 'react';
export class Home extends React.Component{
    render(){
        return(

                <div className="card">
                    <div class="card mb-3" width="1000">
                    <div className="row">
                    <div class="row g-0">
                        <div class="col-md-4">
                                     <img src="https://thumbs.dreamstime.com/b/black-hacker-software-engineer-symbol-white-background-concept-depicting-danger-using-internet-protection-co-117453507.jpg" class="img-fluid rounded-start" alt="" width="300" height="300"/>
                             </div>
                             <div class="col-md-8">
                                <div class="card-body">
                                 <h2 class="card-title">Sample</h2>
                                 <p class="card-text">
                                    <h5>A software engineer is a person who applies the principles of software engineering to design, develop, maintain, test, and evaluate computer software. The term programmer is sometimes used as a synonym, but may also lack connotations of engineering education or skills.</h5>
                                 </p>

                                 </div>
                                </div>
                    </div>
                    </div>
            </div>
            </div>
        );
    }
}
